export const LeftBar = () => {
  let LeftBarStyles = {
    div: {
      backgroundColor: 'lightPink',
      height: '690px',
      width: '200px',
    },
  }
  return (
    <div style={LeftBarStyles.div}>
      <br />
      <span style={LeftBarStyles.span}>Management Section</span>
      <ul
        style={{
          listStyleType: 'none',
          padding: 0,
          margin: 0,
          textAlign: 'left',
        }}
      >
        <li>Create Post</li>
        <li>Recent Posts</li>
        <li>Profil Setting</li>
      </ul>
    </div>
  )
}
